import { Swiper, SwiperSlide } from "swiper/react";
import { Autoplay, Navigation } from "swiper/modules";
import "swiper/css";
import "swiper/css/navigation";
import './Carousel.css'

export default function Carousel() {
  return (
    <Swiper
      modules={[Autoplay, Navigation]}
      autoplay={{ delay: 3000 }}
      navigation={true}
      loop={true}
    >
      <SwiperSlide><img src="data:image/jpeg;base64," alt="Slide 1" /></SwiperSlide>
      <SwiperSlide><img src="data:image/jpeg;base64," alt="Slide 2" /></SwiperSlide>
      <SwiperSlide><img className="image" src="data:image/jpeg;base64," alt="Slide 3" /></SwiperSlide>
    </Swiper>
  );
}
